:0.5},"x":{"field":"x"},"y":{"field":"y"}},"id":"72276","type":"Circle"},{"attributes":{"text":"As predi\u00e7\u00f5es apresentadas s\u00e3o realizadas com base em um modelo ARX (Auto-Regressivo com entradas eX\u00f3genas) em que as entradas s\u00e3o os dados do google mobility (percentagem de pessoas nas resid\u00eancias) atrasados em 10 dias. \u00c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"79004","type":"Paragraph"},{"attributes":{"data_source":{"id":"72279"},"glyph":{"id":"72280"},"hover_glyph":null,"muted_glyph":null,"name":" Alagoas","nonselection_glyph":{"id":"72281"},"selection_glyph":null,"view":{"id":"72283"}},"id":"72282","type":"GlyphRenderer"},{"attributes":{"source":{"id":"72274"}},"id":"72278","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"value":"white"},"line_alpha":{"value":0.1},"line_color":{"value":"#1f77b4"},"size":{"units":"screen","value":0.5},"x":{"field":"x"},"y":{"field":"y"}},"id":"71796","type":"Circle"},{"attributes":{"line_alpha":0.1,"line_color":"#a6cee3","line_width":2.5,"x":{"field":"x"},"y":{"field":"y"}},"id":"72281","type":"Line"},{"attributes":{"data_source":{"id":"71799"},"glyph":{"id":"71800"},"hover_glyph":null
